import Navi from './Navi/Navi';
import Textbar from './Textbar/Textbar';
import Textcontent from './Textcontent/Textcontent';
import './Main.css'

const Main = () => {
    return(
        <div>
            <Navi/>
            <div className="container">
                <div className="form_2">
                <Textbar/>
                </div>
                <div className="form_3">
                <Textcontent/>
                </div>
            </div>
        </div>
        )
}

export default Main;
